export default function Contant() {
    const { title, setTitle } = useState('');
    return (
        <div className="contant" style={{ minHeight: 750 }}>
            <div className="lgrid">
                <div class="grid-item-l" >
                    <div style={{ fontSize: 100, fontFamily: "Courier New", fontWeight: "bold" }}>
                        Contant
                    </div>
                </div>
            </div>
        </div>
    )
}
